import React from 'react';
import { 
    Timeline, 
    TimelineItem, 
    TimelineSeparator, 
    TimelineDot, 
    TimelineConnector, 
    TimelineContent 
  } from '@mui/lab';

  // import TimelineOppositeContent, {
  //   timelineOppositeContentClasses,
  // } from '@mui/lab/TimelineOppositeContent';

  import { timelineContentClasses } from '@mui/lab/TimelineContent';
  import TimelineOppositeContent from '@mui/lab/TimelineOppositeContent';


const Experience = () => {
  return (
    <div>
      <Timeline>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            June 2023 - August 2023
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Math and English Tutor @ Kumon</h4>
            <p>• Tutored students of all ages in Math and English through personalized teaching methods to increase comprehension
            of skills</p>
            <p>• Maintained accurate records and performed timely data entry of student grades into the gradebook system
            </p>
          </TimelineContent>
        </TimelineItem>
      </Timeline>
      


      <Timeline>
        <TimelineItem>
          <TimelineOppositeContent color="textSecondary">
            February 2024 - Present
          </TimelineOppositeContent>
          <TimelineSeparator>
            <TimelineDot />
            <TimelineConnector />
          </TimelineSeparator>
          <TimelineContent>
            <h4>Design Consultant @ Illinois Design Consulting</h4>
            <p>• • Designing UI/UX for cybersecurity platform startup Provenance Security using Miro and Figma to create intuitive
and cohesive interfaces
</p>
            <p>• Collaborated with cross-functional teams to deliver high-quality software solutions</p>
          </TimelineContent>
        </TimelineItem>
      </Timeline>
    </div>
  );
};

export default Experience;



